  false,\n\t\"url\": null,\n\t\"notes\": \"This layer contains polygon data for the
  perennial pepperweed (Lepidium latifolium) database. This database represents the
  areas surveyed throughout the San Francisco Bay, San Pablo Bay and Suisun Bay in
  California between July, 2004 and June, 2007. Perennial pepperweed is a non-native
  invasive plant that is currently invading wetland, riparian and cultivated areas
  throughout California. The area surveyed was identified using aerial images. This
  data layer is to be used in association with the shapefile, \"Perennial Pepperweed
  Patches - San Francisco Estuary [ds295]\" which shows the patches of Lepidium latifolium
  mapped within the areas surveyed.\",\n\t\"license_title\": null,\n\t\"extras\":
